/* eslint-disable jsx-a11y/anchor-is-valid */
import {Routes, Route} from 'react-router-dom'
import Header from './components/HeaderNavbar/Header';

function App() {
  return (
    <div className="app">
      <Header/>

      <Routes>
        <Route path="/" element=''/>
        <Route path="/news" element=''/>
        <Route path="/contact" element=''/>
      </Routes>
    </div>
  );
}

export default App;
